import React from 'react'

function Posts() {
    return (
        <>
         <img src="abc.com" height="100px" width="100px" alt="image"/>
         <h4>Author</h4>
         <h5>Category</h5>
         <h4>Title</h4>
         <h5>Intro</h5> 
        </>
    )
}

export default Posts
